--STEP 01
--The assertion is that the BMI is missing for all of the following.
--The RULE is that Weight and Height MUST be present to provide BMI
--The validation: Determine which of the suspect data that was provided 
--	   has the required data components to produce BMI.
--	   And, check this across all 3 prod instances.
--The Check: validate which of the three required tables contains the 
--	   MPI and ItemID provided as the suspect BAD data.
--FINDINGS: Only one row exists in the data. I cannot validate the LOAD process, but Shange did.
--	   Both Height and Weight must be provided to calcualte BMI. Is it possible that the data 
--	   passed in from the client was missing either height or weight?

DECLARE @MPITBL TABLE (
  [MPI]  bigint ,	   -- NOT NULL PRIMARY KEY,
  ItemID int,
  UNIQUE NONCLUSTERED ([MPI], ItemID) 
  ) 


select count(*) as HACNT from CMS_User as U
    join CMS_USerSettings as US 
	   on U.UserID = US.UserSettingsID
    join HFit_HealthAssesmentUserStarted as B
	   on U.UserID = B.UserID
    join @MPITBL as M
	   on M.[MPI] = US.HFitUserMpiNumber
		  AND M.ItemID = B.ItemID

select count(*) as BMICNT from CMS_User as U
    join CMS_USerSettings as US 
	   on U.UserID = US.UserSettingsID
    join HFIT_TrackerBMI as B
	   on U.UserID = B.UserID
    join @MPITBL as M
	   on M.[MPI] = US.HFitUserMpiNumber
		  AND M.ItemID = B.ItemID

select count(*) as HGTCNT from CMS_User as U
    join CMS_USerSettings as US 
	   on U.UserID = US.UserSettingsID
    join HFIT_TrackerHeight as H
	   on U.UserID = H.UserID
    join @MPITBL as M
	   on M.[MPI] = US.HFitUserMpiNumber
		  AND M.ItemID = H.ItemID

select count(*) as WGTCNT from CMS_User as U
    join CMS_USerSettings as US 
	   on U.UserID = US.UserSettingsID
    join HFIT_TrackerWeight as W
	   on U.UserID = W.UserID
    join @MPITBL as M
	   on M.[MPI] = US.HFitUserMpiNumber
		  AND M.ItemID = W.ItemID

select top 10 * from view_EDW_TrackerCompositeDetails
select top 10 * from view_EDW_Biometrics

SELECT	  --COUNT(*)
UserSettings.HFitUserMpiNumber
, TkrBMI.ItemID 
, UserSettings.UserSettingsUserID
