FROM dbo.HFit_TrackerBMI as TkrBMI     
    INNER JOIN CMS_USerSEttings AS UserSettings
	   on TkrBMI.UserID = UserSettings.UserSettingsUserID
    INNER join @MPITBL as MT
	   on MT.[MPI] =  UserSettings.HFitUserMpiNumber	 --UP TO THIS POINT, THERE ARE 98665 ROWS IN PROD 1
		  and TkrBMI.ItemID = MT.[ItemID]			 --WHEN INCLUDING THIS QUALIFIER, WE GO TO 1 ROW SHOWING THAT THE ItemID(s) do not exist. 

    INNER JOIN Hfit_TrackerHeight AS TrkHeight
	   on TkrBMI.UserID = TrkHeight.UserID                   
    INNER JOIN Hfit_TrackerwEIGHT AS TrkWeight
	   on TkrBMI.UserID = TrkWeight.UserID                   
		  AND TrkWeight.EventDate = TrkHeight.EventDate        
    
